import React from "react";
import "./style.css"
//import styled from "styled-components";
/*function Header(){
  return <h1>React Calculator</h1> ;
}*/
export default function Buttons() {
  const buttons = ["%","CE","C" ,"DEL" ,"1/x" ,"x²", "√x","÷","7", "8", "9" ,"×",, "4" , "5" ,"6"  , "*", "1", "2" ,"3" , "/", "=" ,"0", "." ];
  return(
    <>
    <div id="keys">
      {buttons.map((x) => {
        return <button key={x}>{x}</button>
      })}
    </div>
    </>

  );

}
